  return (
    <div className="ui container comments">
      <CommentDetail author="Sam" timeAgo="Today at 12:00PM" content="Nice blog post!" />
      <CommentDetail author="Alex" timeAgo="Today at 02:00PM" content="Nice blog post!"/>
      <CommentDetail author="Jane" timeAgo="Today at 03:00PM" content="Nice blog post!"/>
    </div>
  );
};

ReactDOM.render(<App />, document.querySelector('#root'));
